Sometimes life really does live up to your dreams! ✨

If you couldn’t tell, I am a picnic fanatic and have enjoyed several this summer! The more over the top the better. They can be silly, fun, romantic, casual or dreamy. A picnic is perfect for any occasion. This was  a fall picnic that we did but I wanted to give you some ideas! I loved the tent in this one, and the beautiful glasses and plates. Flowers are always a must and so are linens. Pillows also give it a more romantic feel. 

